import styled from 'styled-components'

export const StyledContainer = styled.div`
   
   max-width: 100%;
   background: rgb(51,51,61);
background: linear-gradient(142deg, rgba(51,51,61,0.9780287114845938) 0%, rgba(0,0,0,0.06486344537815125) 69%, rgba(59,98,105,0.028448879551820738) 100%);margin: 10px auto;
    

   article {
        display: flex;
   }
`
